import unittest #I just cut my finger on the fucking keyboard like how on earth did i manaed thatfrom Converter import ConvertingConverter = Converting()class test_converter(unittest.TestCase):        def test_temperature(self):        self.assertEqual(Converter.TemperatureCtoF(50), 122, "50C is 122 fahrenheit according to DuckDuckGo converter")        self.assertEqual(Converter.TemperatureCtoF(-50), -58, "-50C is -58F according to DuckDuckGo converter")        self.assertEqual(Converter.TemperatureFtoC(50), 10, "50F is 10C according to duckduckgo converter")        self.assertAlmostEquall(Converter.TemperatureFtoC(-50), -45.55, "-50F is -45.55556C according to DuckDuckGo converter")    def test_Measurment(self):        self.assertAlmostEqual(Converter.MeasurmentWorldtoUS(10, "km"), 6.214, "")        self.assertAlmostEqual(Converter.MeasurmentWorldtoUS(10, "m"), 10.936, "")        self.assertAlmostEqual(Converter.MeasurmentWorldtoUS(10, "cm"), 0.328, "")        self.assertAlmostEqual(Converter.MeasurmentWorldtoUS(10, "mm"), 0.0109, "")        self.assertAlmostEqual(Converter.MeasurmentUStoWorld(10, "mi"), 16.093, "")        self.assertAlmostEqual(Converter.MeasurmentUStoWorld(10, "yd"), 9.144, "")        self.assertAlmostEqual(Converter.MeasurmentUStoWorld(10, "ft"), 304.8, "")        self.assertAlmostEqual(Converter.MeasurmentUStoWorld(10, "in"), 254, "")    def test_speed(self):        self.assertAlmostEqual(Converter.SpeedKMHtoMPH(10), 6.2, "")        self.assertAlmostEqual(Converter.SpeedMPHtoKMH(10), 16.1, "")if __name__ == "__main__":    unittest.main()